import React, { Component } from "react";

class SingleBuyOrder extends Component {
	render() {
		return (
			<React.Fragment>
				<div>this.props.buyOrdersArray.map((order) => {<p>{order.id}</p>})</div>
			</React.Fragment>
		);
	}
}

export default SingleBuyOrder;
